import NavigationBar from "./Components/navbar/NavigationBar";
import PageRoutes from "./Components/navbar/Routes";

function App() {
  window.onbeforeunload = function() {
    localStorage.clear();
  };


  return (
    <div className="App">

      <NavigationBar />

      <PageRoutes className="pagesRouts" />
    </div>
  );
}

export default App;
